import "./HomePage.css";
import image from "../assets/search.png";
function CenterPieces(props) {
  return <div>{props.value}</div>;
}

const HomePage = () => {
  return (
    <div id="menu-outer">
      <div class="image">
        <CenterPieces
          value={<img className="resize" src={image} alt="react"></img>}
        />
      </div>
      <div class="text">
        <CenterPieces value={<h1>Pocket Watcher</h1>} />
      </div>
      <div class="description">/></div>
    </div>
  );
};

export default HomePage;
